class Home extends Component {
    constructor() {
        super();
        this.state = { items: [] };
        this.state= {users:[]}
    }

    componentDidMount() {
        fetch('http://localhost:44308/api/persona')
        .then(result=>result.json())
        .then(items=>this.setState({items}))
    }

    render() {
        return(
            <div>
                <ul>
                    {
                         this.state.items.map((item) =>{
                            return(
                                 <li></li>
                            )
                        })
                    }
                </ul>
            </div>
        )
    }
}


export default Home
